package cn.iutils.common.controller;

import java.io.File;

import javax.servlet.http.HttpServletRequest;
import javax.servlet.http.HttpServletResponse;

import org.apache.commons.codec.binary.Base64;
import org.apache.commons.lang3.RandomUtils;
import org.springframework.web.bind.annotation.RequestMapping;
import org.springframework.web.bind.annotation.RequestMethod;
import org.springframework.web.bind.annotation.RequestParam;
import org.springframework.web.bind.annotation.ResponseBody;
import org.springframework.web.bind.annotation.RestController;
import org.springframework.web.multipart.MultipartFile;

import com.jf.plus.common.core.Constants;
import com.jf.plus.common.core.Result;
import com.jf.plus.common.core.ResultCode;
import com.jf.plus.common.core.ResultObj;

import cn.iutils.common.config.JConfig;
import cn.iutils.common.utils.JFileUtils;
import cn.iutils.common.utils.JUploadUtils;

/**
 * 上传控制器
 * 
 * @author cc
 */
@RestController
@RequestMapping(value = "/api/upload")
public class MobileUploadController extends BaseController {

	/**
	 * 上传文件
	 * 
	 * @param file
	 * @param response
	 * @param request
	 * @return
	 */
	@RequestMapping(value = { "/local" }, method = RequestMethod.POST)
	@ResponseBody
	public Result uploadFile(@RequestParam(value = "file", required = false) MultipartFile file,
			HttpServletResponse response, HttpServletRequest request) {
		Result resultVo = new Result();
		try {
//			String fileName = file.getOriginalFilename();
			File targetFile = JUploadUtils.save(file, request);
			resultVo.setCode(ResultCode.SUCCESS);
			resultVo.setObj(targetFile.getName());
		} catch (Exception e) {
			e.printStackTrace();
			resultVo = Result.newExceptionInstance();
		}
		return resultVo;
	}

	/**
	 * Base64
	 * 
	 * @param file
	 * @param response
	 * @param request
	 * @return
	 */
	@RequestMapping(value = { "/base64" }, method = RequestMethod.POST)
	@ResponseBody
	public Result uploadFile(@RequestParam(value = "data", required = true) String data,
			@RequestParam(value = "imageName", required = true) String fileName, HttpServletResponse response,
			HttpServletRequest request) {
		Result resultVo = new Result();
		try {
			//logger.debug("fileName:" + fileName + ",data:" + data );
			data = data.substring(data.indexOf(",") + 1);
			String path = JConfig.getConfig(JConfig.FILEUPLOAD);

			// 取得后缀
			String suffixString = fileName.substring(fileName.lastIndexOf(".") + 1);
			String randomFileName = System.currentTimeMillis() + "_" + RandomUtils.nextInt(1000, 9999);
			// 设定文件名称
			fileName = randomFileName + "." + suffixString;

			File targetFile = new File(path, fileName);
			JFileUtils.writeByteArrayToFile(targetFile, Base64.decodeBase64(data));
			
			resultVo.setCode(ResultCode.SUCCESS);
			ResultObj resultObj = new ResultObj();
			resultObj.put("imageName", fileName);
			resultObj.put("imageUrl", Constants.URL_IMAGE.concat("/").concat(fileName));
			resultVo.setObj(resultObj);
		} catch (Exception e) {
			e.printStackTrace();
			resultVo = Result.newExceptionInstance();
		}
		return resultVo;
	}
	
	public static void main(String[] args) throws Exception{
//		String data = "";				
//		JFileUtils.writeByteArrayToFile(new File("D:\\1.jpg"), Base64.decodeBase64(data));
	}

}
